import React from "react";

export const Tile = ({name, description}) => {


  
  return (
    <div className="tile-container">
      <p className = 'tile-title'>{name}</p>
      {
          Object.keys(description).map((key,i) => {
            if (key !== 'name') {
              return <p className = 'tile' key = {i}>{description[key]}</p>;
            }
        })
      }
    </div>
  );
};
